import React from "react";
import PrincipalImage from "./PrincipalImage.png";
import './branchStyle.css'

export default function AutomobilePage() {
  // const mainContainer = {
  //   backgroundColor: "#f5f5f5",
  //   fontFamily: "Arial, sans-serif",
  //   textAlign: "left",
  //   paddingLeft: "80px",
  //   paddingRight: "80px",
  // };

  // const leftContainer = {
  //   boxShadow: "0 4px 8px rgba(0,0,0,0.1)",
  //   backgroundColor: "white",
  //   marginTop:'20px',
  //   marginBottom:'20px',
  //   marginRight:'40px',
  //   padding: "20px",
  // };

  // const rightContainer = {
  //   boxShadow: "0 4px 8px rgba(0,0,0,0.1)",
  //   backgroundColor: "white",
  //   padding: "20px",
  //   marginTop:'20px',
  //   marginBottom:'20px',
  //   height: 'auto',
  //   maxHeight: '800px', // Set a maximum height if needed
  //   overflowY: 'auto',
  // };

  // const hodContainer = {
  //   textAlign: "center",
  //   padding: "10px",
  // };

  // const imageStyle = {
  //   width: "150px" /* Adjust the size of the circular image */,
  //   height: "150px",
  //   borderRadius: "50%" /* Creates a circular clipping mask */,
  //   overflow: "hidden" /* Ensures the image stays within the circular mask */,
  // };

  return (
    <div className='main-container'>
      <div className="row" >
        <div className="left-container col-md-8">
          <h1 style={{fontFamily:'times new roman', color:'hsl(205, 85%, 25%)'}}>Automobile Engineering</h1>
          <p>
            Department was established in year 1957. It started functioning
            under Autonomous Polytechnic when the Institute was awarded Academic
            Autonomy.
          </p>
          <br />
          <table>
            <tr>
              <th>Intake</th>
              <td>:</td>
              <td>60</td>
            </tr>
            <tr>
              <th>Head of Department</th>
              <td>:</td>
              <td>01</td>
            </tr>
            <tr>
              <th>No. of fauclty</th>
              <td>:</td>
              <td>10</td>
            </tr>
            <tr>
              <th>No. of supporting staff</th>
              <td>:</td>
              <td>5</td>
            </tr>
          </table>
          <br />
          <table style={{ border: "2px solid #f5f5f5", textAlign: "center" }}>
            <style jsx>{`
              th,
              td {
                padding: 2px;
              }
            `}</style>
            <tr
              style={{
                backgroundColor: "hsl(205, 85%, 35%)",
                color: "white",
                padding: "10px",
              }}
            >
              <th>Sr. no.</th>
              <th>Name of the Programme</th>
              <th>Approved by</th>
              <th>Affiliated Body</th>
              <th>Annual Intake</th>
            </tr>
            <tr>
              <td>1</td>
              <td>Diploma in Automobile Engineering</td>
              <td>AICTE</td>
              <td>
                State Board of Technical Education and Training, Telangana
              </td>
              <td>60</td>
            </tr>
          </table>
          <br />
          <h2 style={{fontFamily:'times new roman', color:'hsl(205, 85%, 25%)'}}>Vision</h2><hr />
          <p>
            Lorem, ipsum dolor sit amet consectetur adipisicing elit. Quidem iste veniam officia quod? Tempore porro consequuntur fuga sapiente, cum dignissimos unde, sequi quod harum quibusdam voluptas eaque mollitia placeat repellat.
          </p>
          <h2 style={{fontFamily:'times new roman', color:'hsl(205, 85%, 25%)'}}>Mission</h2><hr />
          <p>
            <ol>
              <li></li>
              <li></li>
              <li></li>
              <li></li>
              <li></li>
            </ol>
          </p>
          <h2 style={{fontFamily:'times new roman', color:'hsl(205, 85%, 25%)'}}>Program Outcomes (POs)</h2><hr />
          <ul>
            <li></li>
            <li></li>
            <li></li>
            <li></li>
            <li></li>
          </ul>
          <h2 style={{fontFamily:'times new roman', color:'hsl(205, 85%, 25%)'}}>Program Specific Outcomes (PSOs)</h2><hr />
          <ul>
            <li></li>
            <li></li>
            <li></li>
            <li></li>
            <li></li>
          </ul>
          <h2 style={{fontFamily:'times new roman', color:'hsl(205, 85%, 25%)'}}>Program Educational Objectives (PEOs)</h2><hr />
          <ul>
            <li></li>
            <li></li>
            <li></li>
            <li></li>
            <li></li>
          </ul>
        </div>
        <div className="right-container col-md-3">
          <h2 style={{fontFamily:'times new roman', color:'hsl(205, 85%, 25%)'}}>HOD's Desk</h2>
          <div className='hod-container'>
          <img src={PrincipalImage} alt="principalPhoto" style={imageStyle} />{" "}
          <br />
